import { useContext } from "react";
import CartContext from "../../Store/cart-context.js";
import HeaderCartButton from "./HeaderCartButton.js";
import classes from "./Header.module.css";

const Header = (props) => {
  const cartCtx = useContext(CartContext);

  const numberOfCartItems = cartCtx.items.reduce((cur) => {}, 0);
  return (
    <Fragment>
      <header className={classes.header}>
        <h1>ReactMeals</h1>
        <div>
          <HeaderCartButton onClick={props.onShowCart} />
        </div>
      </header>
      <div className={classes["main-image"]}>
        <img
          src="https://images.unsplash.com/photo-1576866209830-589e1bfbaa4d?q=80&w=2940&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
          alt=""
        />
      </div>
    </Fragment>
  );
};

export default Header;
